response.about:
Когда в толпе ты встретишь человека,
На коем фрак;
Чей лоб мрачней туманного Казбека,
Неровен шаг;
Кого власы подьяты в беспорядке;
Кто, вопия, 
Всегда дрожит в нервическом припадке,
Знай: это я! 
(с)
Очень простой сложный человек. Многие считают, что я- хороший. Что ж, я с ними не спорю.
